export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:b,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:b,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:b,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:e,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:e,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},ZTASWvrJ7C:{data:{id:1551,attributes:{imdbId:"tt0300015",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BOWQxZDUyODctMDc0Ni00OTgwLWIxZWItZWFkZWFkZDU3OWQ3XkEyXkFqcGdeQXVyNzQ5MzY0NjM@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.9\u002F10"},{Source:"Rotten Tomatoes",Value:"79%"},{Source:"Metacritic",Value:"63\u002F100"}],item_lang:{data:{id:2214,attributes:{title:c,plot:"The film follows 17-year-old Cassandra Mortmain, and the fortunes of her eccentric family, struggling to survive in a decaying English castle. Her father is desperate to repeat the spectacular success of his first novel, but hasn't written a word for 12 years; her exquisite sister Rose can only rail against their fate, and their Bohemian step-mother Topaz is a nudist and no help at all. Salvation comes in the form of their American landlord Simon Cotton and his brother Neil. Although initially repelled by Simon, Rose is determined to make him fall in love with her and succeeds. A wedding is arranged and Cassandra is left on the sidelines as everyone around her is drawn into a maelstrom of interconnected relationships. But events spiral out of control, and before the summer ends she will experience frustrated desire, first love, and a broken heart.",slug:"i-capture-the-castle"}}},books:{data:[{id:8134,attributes:{title:c,description:"One of the 20th Century's most beloved novels is still winning hearts! I Capture the Castle tells the story of seventeen-year-old Cassandra and her family, who live in not-so-genteel poverty in a ramshackle old English castle. Here she strives, over six turbulent months, to hone her writing skills. She fills three notebooks with sharply funny yet poignant entries. Her journals candidly chronicle the great changes that take place within the castle's walls, and her own first descent into love. By the time she pens her final entry, she has \"captured the castle\"-- and the heart of the reader-- in one of literature's most enchanting entertainments. “This book has one of the most charismatic narrators I've ever met.” -- J.K. Rowling, author of the Harry Potter series",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8KhXzo96YjkC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:true,published:"2003-04-01",publisher:"St. Martin's Press",subtitle:a}},{id:8135,attributes:{title:c,description:h,thumbnail:i,authors:[d],firstBook:f,published:j,publisher:k,subtitle:l}},{id:8136,attributes:{title:c,description:h,thumbnail:i,authors:[d],firstBook:f,published:j,publisher:k,subtitle:l}},{id:8137,attributes:{title:"I Capture the Castle. A Romantic Comedy by Dodie Smith, Adapted from Her Novel of the Same Name. [With Plates.].",description:a,thumbnail:a,authors:[d],firstBook:f,published:"1954-01-01",publisher:a,subtitle:a}},{id:8138,attributes:{title:c,description:"This is the story of seventeen-year-old Cassandra and her eccentric family, who live in a ramshackle old English castle in the 1930s. Her journals candidly chronicle the great changes that take place within the castle walls, and her own first experiences with love.",thumbnail:a,authors:[d],firstBook:f,published:"2009-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1694069555070}}("","movie","I Capture the Castle","Dodie Smith","series",null,1,"A Wednesday Books reissue of one of the century's most beloved novels, I Capture the Castle by Dodie Smith, with a foreword by New York Times bestselling author, Jenny Han. Seventeen-year-old Cassandra Mortmain and her family live in not-so-genteel poverty in a ramshackle old English castle. Here she strives, over six turbulent months, to hone her writing skills. She fills three notebooks with sharply funny yet poignant entries. Her journals candidly chronicle the great changes that take place within the castle’s walls, and her own first descent into love. By the time she pens her final entry, she has “captured the castle” –and the heart of the reader- in one of literature’s most enchanting entertainments.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=_X1EDgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2017-10-10","St. Martin's Griffin","Young Adult Edition"))